import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
function Min() {
  return (
    <>
      <h1 className="text-center text-danger">hello</h1>
      <div class="container">
        <div class="row">
          <div class="col-sm">One of three columns</div>
          <div class="col-sm">One of three columns</div>
          <div class="col-sm">One of three columns</div>
        </div>
      </div>
    </>
  );
}
export default Min;
